 
var pageArray =new Array(3);
var eventArray =new Array(3);


$(document).ready(function()
{
       $.ajax({
                type:       "get",
        url:        "getUserInfo",
        success:    function(msg) 
        {
                if(msg.indexOf("error") > -1)
                  window.location = "index.jsp";
                $('.profile-box').html(msg);
                }
              });
       
       
       $.ajax({
           type:       "get",
		   url:        "getPageInfo",
		   success:    function(msg) 
		   {
			   var f= msg.split("|");
			   pageArray =new Array(f.length);
			   for(var i=0;i<f.length;i++)
			   {				   
			      pageArray[i]=f[i].split(',');  
			   }
           }
         });
       
       
       $.ajax({
           type:       "get",
		   url:        "getEventInfo",
		   success:    function(msg) 
		   {
			   var f= msg.split("|");
			   eventArray =new Array(f.length);
			   for(var i=0;i<f.length;i++)
			   {				   
				   eventArray[i]=f[i].split(',');  
			   }
           }
         });
       
       


       
});

var uploadImg = "data:image/png;base64,";

function getDivInsert(type)
{

  $.ajax({
         type:       "get",
         url :       "getDivInsert",
         data: {'TYPE':type},
         success:    function(msg) 
         {
                // alert(' msg '+msg); 
                 document.getElementById('main-content').innerHTML=msg;
                 
                 if(type=='LinkAdd'){
                   linkDivAdd();
                 }
                 
                 if(type=='EventAdd'){
                     eventDivAdd();
                   }
                     
                 if(type=='deleteLink'){
                	 
                	 linkDelete();
                 }
             	if(type=='deletePhoto'){
                	 
                	 photoDelete();
                 }
             		if(type=='deleteStatus'){
                   	 
                   	statusDelete();
                    }
             		
             		if(type=='deleteAll'){
                      	 
                       	allDelete();
                        }
             		
             	
         }
       });
}


