function getDate()
{
	var today = new Date();
	var dd = today.getDate();
	var mm = today.getMonth()+1; //January is 0!
	var yyyy = today.getFullYear();
	var h = today.getHours();
	var m = today.getMinutes();
	
	
	if(dd<10) 
	{
	    dd='0'+dd;
	} 

	if(mm<10) 
	{
	    mm='0'+mm;
	}
	
	if(m>40)
	{	
		h=h+1;	
	}
	m=(m+20)%60;
	
	
	if(h<10) 
	{
	    h='0'+h;
	} 

	if(m<10) 
	{
	    m='0'+m;
	} 

	today =yyyy+'-'+mm+'-'+dd+'T'+h+':'+m;
	return today;
}


function getDatePlusMonthly(timePerH,timePerM)
{
	var nextDate = document.getElementById("datetime").value;
	
	var today = new Date(nextDate);
	var dd = today.getDate();
	var mm = today.getMonth()+1; //January is 0!
	var yyyy = today.getFullYear();
	var h = 00;
	var m = 00;

	if(dd<10) 
	{
	    dd='0'+dd;
	} 

	
	if(mm<10) 
	{
	    mm='0'+mm;
	}
	
	
	m+=timePerM;
	h+=timePerH;
	
	if(h<10) 
	{
	    h='0'+h;
	} 

	if(m<10) 
	{
	    m='0'+m;
	} 

	if(h==24 && m==00)
	{	
		h=23;
		m = 59;
		
	}
	
	if(h==23 && m==60)
	{	
		h=23;
		m = 59;
		
	}
	today =yyyy+'-'+mm+'-'+dd+'T'+h+':'+m;
	
	//alert(today);
	return today;
}


