function readURLMultiple(input) 
{
	var counter = 0;
	var len = input.files.length-1;
	
	var today = new Date();
	var h = today.getHours();
	var m = today.getMinutes()+20;
	
	var remH = 24 - h;
	var remM = 60 - m;
	
	var totalMin = (remH*60) +remM; 
	
	var timePerPost = totalMin/len;
		
	
    if (input.files)
    for(var i=0;i<input.files.length;i++)	
    {
        var reader = new FileReader();
        
        reader.onload = function (e)
        {
        	var timePerPostDiv = timePerPost*counter;
        	var timePerH = parseInt( timePerPostDiv/60);
        	var timePerM = parseInt( timePerPostDiv%60);
        	if(len==0)
        	{
        		 timePerH = 0;
            	 timePerM = 0;
        	}
        	//alert(" timePerPostDiv"+timePerPostDiv+" H "+timePerH+" M "+timePerM);
            MPSP_ADD(e.target.result,timePerH,timePerM);
            counter++;
        };
        
        reader.readAsDataURL(input.files[i]);
    }
}
