function getSelectedOptions(sel) 
{
	
	var result="";
    var opt;  
    for (var i=0, len=sel.options.length; i<len; i++)
    {
        opt = sel.options[i];
       if ( opt.selected ) 
        {
            result+=opt.value+",";
        }
    }
    
    return result;
}





function submitDeleteForm(rand)
{

  event.preventDefault();
  var load =document.getElementById('load_'+rand);
  load.style.visibility='visible';
  
  var roundDiv =document.getElementById('roundDiv_'+rand);
  roundDiv.style.opacity='0.9';
  
  var select_value=document.getElementById('select_'+rand);
  var number_value=document.getElementById('number_'+rand).value;
  var opts = getSelectedOptions( select_value);
  
  
  $.ajax({
                     type:       "post",
                     url :       "deleteLinkFeed",
                     data: {select_value:encodeURIComponent(opts),limit :encodeURIComponent(number_value)},
                     success:    function(msg) 
                     {
                             alert(msg); 
                             load.style.visibility='hidden';
                             roundDiv.style.opacity='0.9';

                     }
                   });
     return false;
}



